/*
    Q1
*/

CREATE TABLE FLUX (
    YEAR NUMBER,
    WEEK NUMBER,
    DATEFROM DATE,
    DATETO DATE,
    ILI_GOPC NUMBER,
    ILI_PMP NUMBER,
    H1 NUMBER,
    H3 NUMBER,
    B NUMBER,
    AandB NUMBER,
    H1_proportion NUMBER,
    H3_proportion NUMBER,
    B_proportion NUMBER,
    AandB_proportion NUMBER,
    ILI_School NUMBER,
    ILI_NonSchool NUMBER,
    Adm_0_5 NUMBER,
    Adm_6_11 NUMBER,
    Adm_12_17 NUMBER,
    Adm_18_49 NUMBER,
    Adm_50_64 NUMBER,
    Adm_65_higher NUMBER,
    Adm_ALL NUMBER,
    ILI_AED NUMBER,
    Fever_CCCKG NUMBER,
    Fever_RCHE NUMBER,
    ILI_CMP NUMBER,
    SevereCase_0_17 NUMBER,
    SevereCase_18_49 NUMBER,
    SevereCase_50_64 NUMBER,
    SevereCase_65_higher NUMBER
);


/*
    Q2

    Please note that I change the format of the months from the numeric presentation (e.g., '29-12-2013') to their abbreviations (e.g., '29-DEC-2013'')
*/


/*
      Q3
